    public static float arccos(float x){
        return (float) Math.acos(x) + Constants.eps;
    }

    public static float getAngle (float a, float b, float c){
        //double x = (a*a + b*b - c*c)/(2.0f*a*b);
        //return acos[(int)Math.floor((1.0f+x)*1000)];
        return (float) Math.acos((a*a + b*b - c*c)/(2.0f*a*b));
    }

    public static boolean cclockwise (Direction a, Direction b, Direction c, boolean left) { //si a esta a l'esquerra de b (left)
        if (b == null) return true;
        if (a == null) return false;
        return ((c.radiansBetween(a) > c.radiansBetween(b)) == left);
    }




    public static Direction extremeCircleDirection(MapLocation pos, MapLocation nextPos, float stride, MapLocation circlePos, float r, boolean left){
        float d = pos.distanceTo(circlePos);
        if (d > stride + r) return null;
        float angle =  getAngle(stride, d, r);
        if (left) return pos.directionTo(circlePos).rotateLeftRads(angle);
        return pos.directionTo(circlePos).rotateRightRads(angle);
    }

    // Diu si les tres direccions estan en l'ordre en que es passen (d2 esta al mig)
    static boolean areOrdered(Direction d1, Direction d2, Direction d3) {
        boolean ori = (d1.radiansBetween(d3) >= 0);
        return ((d1.radiansBetween(d2) >= 0) == ori) && ((d2.radiansBetween(d3) >= 0) == ori);
    }



    /**
     *
     * @param originalDir direccio original (abans de tenir en compte el rectangle)
     * @param myPos posicio del robot
     * @param nextPos posicio del robot al seguent torn
     * @param stride stride del robot
     * @param bodyRadius body radius
     * @param posb1 posicio 1 de la bala
     * @param posb2 posicio 2 de la bala
     * @param bulletDir dir de la bala
     * @param left si volem anar left o right
     */
    public static Direction extremeRectangleDirection
            (Direction originalDir, MapLocation myPos, MapLocation nextPos, float stride, float bodyRadius, MapLocation posb1, MapLocation posb2, Direction bulletDir, boolean left){
        Direction ans = null; //la direccio que acabem retornant
        float maxd = 0;

        Direction perp1 = bulletDir.rotateLeftRads((float)Math.PI/2);
        MapLocation vertex1 = posb1.add(perp1, bodyRadius);
        MapLocation vertex2 = posb2.add(perp1, bodyRadius);
        Direction dirToV1 = myPos.directionTo(vertex1);
        Direction dirToV2 = myPos.directionTo(vertex2);
        float perpX1 = perp1.getDeltaX(1);
        float perpY1 = perp1.getDeltaY(1);
        float distToRect1 = perpX1*(vertex1.x - myPos.x) + perpY1*(vertex1.y - myPos.y); //distancia fins al rectangle

        if (distToRect1 < 0) {
            perp1 = perp1.opposite(); //perp va del robot a l'aresta del rectangle
            distToRect1 = -distToRect1;
        }

        maxd += Math.abs(perpX1*(vertex1.x - nextPos.x) + perpY1*(vertex1.y - nextPos.y));

        //System.out.println("  abans del primer if d <= stride "+ Clock.getBytecodeNum());
        if (distToRect1 <= stride) {
            float tangentAngle = arccos(distToRect1/stride);
            Direction tangentDirLeft = perp1.rotateLeftRads(tangentAngle);//dir1 fa que t'acostis al maxim al rectangle sense tocarlo
            Direction tangentDirRight = perp1.rotateRightRads(tangentAngle);

            if (areOrdered(dirToV1,tangentDirLeft,dirToV2)){
//            if ((dirToV2.radiansBetween(dir1) >= 0) == ori && (dir1.radiansBetween(dirToV1) >= 0) == ori){
                if (cclockwise(tangentDirLeft, ans, originalDir, left)) ans = tangentDirLeft;
            }

            if (areOrdered(dirToV1,tangentDirRight,dirToV2)){
//            if ((dirToV2.radiansBetween(tangentDirRight) >= 0) == ori && (tangentDirRight.radiansBetween(dirToV1) >= 0) == ori){
                if (cclockwise(tangentDirRight, ans, originalDir, left)) ans = tangentDirRight;
            }
        }
        Direction perp2 = bulletDir.rotateRightRads((float)Math.PI/2);
        MapLocation vertex3 = posb1.add(perp2, bodyRadius);
        MapLocation vertex4 = posb2.add(perp2, bodyRadius);

        Direction dirToV3 = myPos.directionTo(vertex3);
        Direction dirToV4 = myPos.directionTo(vertex4);

        float perpX2 = perp2.getDeltaX(1);
        float perpY2 = perp2.getDeltaY(1);

        float distToRect2 = perpX2*(vertex3.x - myPos.x) + perpY2*(vertex3.y - myPos.y);
        if (distToRect2 < 0) {
            perp2 = perp2.opposite();
            distToRect2 = -distToRect2;
        }

//        System.out.println("  abans del segon if d <= stride "+ Clock.getBytecodeNum());
        if (distToRect2 <= stride) {
            float angle = arccos(distToRect2/stride);
            Direction tangentDirLeft = perp2.rotateLeftRads(angle);
            Direction tangentDirRight = perp2.rotateRightRads(angle);

            if (areOrdered(dirToV4,tangentDirLeft,dirToV3)){
//            if ((dirToV4.radiansBetween(dir1) >= 0) == ori && (dir1.radiansBetween(dirToV3) >= 0) == ori){
                if (cclockwise(tangentDirLeft, ans, originalDir, left)) ans = tangentDirLeft;
            }

            if (areOrdered(dirToV4,tangentDirRight,dirToV3)){
//            if ((dirToV4.radiansBetween(dir1) >= 0) == ori && (dir1.radiansBetween(dirToV3) >= 0) == ori){
                if (cclockwise(tangentDirRight, ans, originalDir, left)) ans = tangentDirRight;
            }

        }
        return ans;
    }


    public static Direction extremeBulletDirection (Direction originalDir, MapLocation pos, MapLocation nextPos, float stride, float r,  BulletInfo bullet, boolean left){ //THE MATRIX HUEHUE
        System.out.println("inici extreme bullet direction" + Clock.getBytecodeNum());
        if (pos == null) return null;
        if (bullet == null) return null;
        MapLocation bulletPos = bullet.getLocation();

        System.out.println("abans del primer circle " + Clock.getBytecodeNum());
        Direction dir = extremeCircleDirection(pos, nextPos, stride, bulletPos,  r, left);

        MapLocation bulletNextPos = bullet.getLocation().add(bullet.getDir(), bullet.speed);
        System.out.println("abans del segon circle " + Clock.getBytecodeNum());
        Direction dir2 = extremeCircleDirection(pos, nextPos, stride, bulletNextPos,  r, left);
        if (cclockwise(dir2, dir, originalDir, left)) dir = dir2;

        System.out.println("abans del rectangle " + Clock.getBytecodeNum());
        Direction dir3 = extremeRectangleDirection(dir, pos, nextPos, stride, r, bulletPos, bulletNextPos, bullet.getDir(), left);

        if (cclockwise(dir3, dir, originalDir, left)) dir = dir3;
        System.out.println("final extreme bullet direction" + Clock.getBytecodeNum() + "\n\n");
        return dir;
    }
